import React, { useContext } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import ProfilePage from './pages/ProfilePage';
import InvestorPage from './pages/InvestorPage';
import StartupPage from './pages/StartupPage';
import AllStartupsPage from './pages/AllStartupsPage';
import AllInvestorsPage from './pages/AllInvestorsPage';
import BlogPage from './pages/BlogPage';
import AllBlogsPage from './pages/AllBlogsPage';
import { AuthContext } from './context/AuthContext';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  const { user } = useContext(AuthContext);

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />
        <Route path="/AllBlogs" element={<AllBlogsPage />} />
        <Route path="/AllStartups" element={<AllStartupsPage user={user}  />} />
        <Route path="/AllInvestors" element={<AllInvestorsPage />} />

        {/* Protected Routes */}
        <Route
          path="/profile"
          element={
            user ? (
              <ProtectedRoute element={<ProfilePage />} />
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />
        <Route
          path="/investor"
          element={
            user && user.role === 'investor' ? (
              <ProtectedRoute element={<InvestorPage />} />
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />
        <Route
          path="/startup"
          element={
            user && user.role === 'founder' ? (
              <ProtectedRoute element={<StartupPage />} />
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />
        <Route
          path="/blog"
          element={
            user ? (
              <ProtectedRoute element={<BlogPage />} />
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
